import React from "react";
import { BrowserRouter } from 'react-router-dom';
import { MDBNav, MDBNavItem, MDBNavLink, MDBRow, MDBCol } from "mdbreact";

export default () => (
  <BrowserRouter>

    <MDBRow>
      <MDBCol>
        <MDBNav className="font-weight-bold">
          <MDBNavLink active to="">Active</MDBNavLink>
          <MDBNavLink to="/Login">Link</MDBNavLink>
          <MDBNavLink to="/Register">Link</MDBNavLink>
        </MDBNav>
      </MDBCol>
    </MDBRow>

  </BrowserRouter>
);
